import React from "react";
// import {} from "./css/bootstrap/"
import "./scss/style.scss";
import Body from "./Body";
import Header from "./Header";

function SignIn() {
  return (
    <html>
      <Header />
      <Body />
    </html>
  );
}

export default SignIn;
